import React, { useEffect, useState } from 'react';
import axios from 'axios';



import './Box.css' ;

function Box (){
  const [data, sepata] = useState([]);
  useEffect(() => {
    axios.get('http://localhost:8081/')
      .then(res => sepata(res.data))
      .catch(err => console.log(err))
  }, []);


  return (
            <>
                <div className="Box" >
         
            {data.map((car, index) => {
              return <p key={index}>
                <p>{car.numcar}</p>
                <p>{car.pan}</p>
                <p>{car.model}</p>
                <p>{car.note}</p>
                
              </p>
            })}
       
            </div>
            </>
      
    
  );


}

export default Box;
